import React, { useState } from 'react';

const SearchFilters = ({ onFilterChange, onSearch }) => {
  const [filters, setFilters] = useState({
    city: '',
    subject: '',
    minPrice: '',
    maxPrice: '',
    minRating: '',
    grade: ''
  });

  const [searchTerm, setSearchTerm] = useState('');

  const cities = [
    'Abşeron', 'Ağcabədi', 'Ağdaş', 'Ağsu', 'Ağdam', 'Ağdərə',
    'Ağstafa', 'Astara', 'Balakən', 'Bakı', 'Beyləqan', 'Biləsuvar',
    
    'Cəlilabad', 'Cəbrayıl', 'Daşkəsən', 'Füzuli', 'Göyçay', 'Göygöl',
    'Goranboy', 'Gəncə', 'Gədəbəy', 'Gözəl', 'Hacıqabul', 'İmişli',
    
    'İsmayıllı', 'Kəngərli', 'Kəlbəcər', 'Kürdəmir', 'Laçın', 'Lənkəran',
    'Lerik', 'Masallı', 'Mingəçevir', 'Naftalan', 'Naxçıvan', 'Neftçala',
    
    'Ordubad', 'Qəbələ', 'Qax', 'Quba', 'Qubadlı', 'Qudyalçay',
    'Qusar', 'Sabirabad', 'Saatlı', 'Samux', 'Şabran', 'Şahbuz',
    
    'Şəmkir', 'Şəki', 'Şirvan', 'Şuşa', 'Siyəzən', 'Tərtər',
    'Tovuz', 'Ucar', 'Xankəndi', 'Xocalı', 'Xaçmaz', 'Xocavənd',
    
    'Yardımlı', 'Yevlax', 'Zaqatala', 'Zəngilan'
  ];


  const subjects = [
    'Riyaziyyat', 'Fizika', 'Kimya', 'Biologiya', 'İngilis dili',
    'Rus dili', 'Azərbaycan dili', 'Tarix', 'Coğrafiya', 'İnformatika',
    'Ədəbiyyat', 'Həndəsə', 'Cəbr', 'Trigonometriya'
  ];

  const grades = [
    '1-4 sinif', '5-9 sinif', '10-11 sinif(Abituriyent)', 
    'Magistratura', 'Doktorantura'
  ];

  const handleFilterChange = (key, value) => {
    const newFilters = { ...filters, [key]: value };
    setFilters(newFilters);
    onFilterChange(newFilters);
  };

  const handleSearch = (e) => {
    e.preventDefault();
    onSearch(searchTerm);
  };

  const clearFilters = () => {
    const emptyFilters = {
      city: '',
      subject: '',
      minPrice: '',
      maxPrice: '',
      minRating: '',
      grade: ''
    };
    setFilters(emptyFilters);
    setSearchTerm('');
    onFilterChange(emptyFilters);
    onSearch('');
  };

  return (
    <div className="bg-white rounded-xl shadow-lg p-6 mb-8">
      <h2 className="text-xl font-bold text-gray-800 mb-6">
        <i className="fas fa-search mr-2 text-blue-600"></i>
        Müəllim Axtarışı
      </h2>

      {/* Axtarış çubuğu */}
      <form onSubmit={handleSearch} className="mb-6">
        <div className="flex space-x-2">
          <input
            type="text"
            value={searchTerm}
            onChange={(e) => setSearchTerm(e.target.value)}
            placeholder="Müəllim adı və ya fənn axtarın..."
            className="input-field flex-1"
          />
          <button
            type="submit"
            className="btn-primary px-6"
          >
            <i className="fas fa-search"></i>
          </button>
        </div>
      </form>

      {/* Filterlər */}
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-4 mb-6">
        {/* Şəhər */}
        <div>
          <label className="block text-sm font-medium text-gray-700 mb-2">
            Şəhər
          </label>
          <select
            value={filters.city}
            onChange={(e) => handleFilterChange('city', e.target.value)}
            className="input-field"
          >
            <option value="">Bütün şəhərlər</option>
            {cities.map((city) => (
              <option key={city} value={city}>{city}</option>
            ))}
          </select>
        </div>

        {/* Fənn */}
        <div>
          <label className="block text-sm font-medium text-gray-700 mb-2">
            Fənn
          </label>
          <select
            value={filters.subject}
            onChange={(e) => handleFilterChange('subject', e.target.value)}
            className="input-field"
          >
            <option value="">Bütün fənnlər</option>
            {subjects.map((subject) => (
              <option key={subject} value={subject}>{subject}</option>
            ))}
          </select>
        </div>

        {/* Sinif */}
        <div>
          <label className="block text-sm font-medium text-gray-700 mb-2">
            Sinif/Səviyyə
          </label>
          <select
            value={filters.grade}
            onChange={(e) => handleFilterChange('grade', e.target.value)}
            className="input-field"
          >
            <option value="">Bütün səviyyələr</option>
            {grades.map((grade) => (
              <option key={grade} value={grade}>{grade}</option>
            ))}
          </select>
        </div>

        {/* Minimum Qiymət */}
        <div>
          <label className="block text-sm font-medium text-gray-700 mb-2">
            Min. Qiymət (₼/ay)
          </label>
          <input
            type="number"
            value={filters.minPrice}
            onChange={(e) => handleFilterChange('minPrice', e.target.value)}
            placeholder="Minimum"
            className="input-field"
            min="0"
          />
        </div>

        {/* Maksimum Qiymət */}
        <div>
          <label className="block text-sm font-medium text-gray-700 mb-2">
            Max. Qiymət (₼/ay)
          </label>
          <input
            type="number"
            value={filters.maxPrice}
            onChange={(e) => handleFilterChange('maxPrice', e.target.value)}
            placeholder="Maksimum"
            className="input-field"
            min="0"
          />
        </div>

        {/* Minimum Reytinq */}
        <div>
          <label className="block text-sm font-medium text-gray-700 mb-2">
            Min. Reytinq
          </label>
          <select
            value={filters.minRating}
            onChange={(e) => handleFilterChange('minRating', e.target.value)}
            className="input-field"
          >
            <option value="">Bütün reytinqlər</option>
            <option value="4">4+ ulduz</option>
            <option value="3">3+ ulduz</option>
            <option value="2">2+ ulduz</option>
            <option value="1">1+ ulduz</option>
          </select>
        </div>
      </div>

      {/* Filterləri təmizlə */}
      <div className="flex justify-end">
        <button
          onClick={clearFilters}
          className="btn-secondary"
        >
          <i className="fas fa-times mr-2"></i>
          Filterləri Təmizlə
        </button>
      </div>
    </div>
  );
};

export default SearchFilters;
